//routing files
import React, {lazy, Component, Suspense} from 'react';
import {getItemLocalStorage} from '../Utils/Util';
import '../Assets/Styles/Common/style.css';
import {STATUS_INACTIVE, STATUS_ACTIVE} from '../Utils/Constants';
import {RENDER_URL} from '../Utils/Urls';
import { BrowserRouter as Router, Switch, Route, Redirect} from 'react-router-dom';

const DashboardComponent = lazy(() => import("../Modules/Dashboard/DashboardComponent"));
const FamilyContainer = lazy(() => import("../Modules/Family/FamilyContainer"));
const MenuPermissionContainer = lazy(() => import("../Modules/MenuPermission/MenuPermissionContainer"));
const ManageUsersContainer = lazy(() => import("../Modules/Users/ManageUsersContainer"));
const CreateEditUsersComponent = lazy(() => import("../Modules/Users/CreateEditUsersComponent"));
const FamilyAreaComponent = lazy(() => import("../Modules/Family/FamilyAreaComponent"));
const ListFamilyContainer = lazy(() => import("../Modules/Family/ListFamilyContainer"));
const UpdateFamilyContainer = lazy(() => import("../Modules/Family/UpdateFamilyContainer"));
const App = lazy(() => import("../App"));

const Routes = () => {
    let isUserLoggedOut = getItemLocalStorage('token') ? STATUS_INACTIVE : STATUS_ACTIVE;
    return (
        <Router>
            <Suspense fallback={<div className="displayNone"> </div>}>
                <Switch>
                    <Route exact path={RENDER_URL.HOME_URL} component={App}/>
                    <Route path={RENDER_URL.DASHBOARD_URL} component={DashboardComponent}/>
                    <Route path={RENDER_URL.MENU_PERMISSION_URL} component={MenuPermissionContainer}/>
                    <Route path={RENDER_URL.ADD_FAMILY_URL} component={FamilyContainer}/>
                    <Route path={RENDER_URL.FAMILY_AREA_URL} component={FamilyAreaComponent}/>
                    <Route path={RENDER_URL.FAMILY_LIST_URL} component={ListFamilyContainer}/>
                    <Route path={RENDER_URL.FAMILY_UPDATE_URL} component={UpdateFamilyContainer}/>
                    <Route path={RENDER_URL.MANAGE_USERS} component={ManageUsersContainer}/>
                    <Route path={RENDER_URL.CREATE_USERS} component={CreateEditUsersComponent}/>
                    <Route path={RENDER_URL.EDIT_USERS} component={CreateEditUsersComponent}/>
                </Switch>
            </Suspense>
            {isUserLoggedOut ? (<Redirect to={'/'}/>) : null}
        </Router>
    )
};

export default Routes;
